import React from "react";
import { useNavigate } from "react-router-dom";

const Products = () => {
	const navigate = useNavigate();

	const navigateHandler = () => {
		navigate("/");
	};
	return (
		<div>
			<h1>Products</h1>
			<button onClick={navigateHandler}>Navigate</button>
		</div>
	);
};

export default Products;
